let movie = fetch('https://api.themoviedb.org/3/movie/now_playing?api_key=15e1bbc41548aa6ea02bac4f092efa6f&language=en-US&page=1')


function NowPlaying() {
    let apiCall = 'https://api.themoviedb.org/3/movie/now_playing?api_key=15e1bbc41548aa6ea02bac4f092efa6f&language=en-US&page=1'
    return (
        <h1 class='page-name'>{movie}</h1>   
